import React from 'react';
import {Image} from 'react-native'
<Image source={require("../.././portfolio_material/portfolio_Header_logo.jpg")}/>

class Header extends React.Component{
  render() {
    return(
     <div className='header'>
       <img src="../.././portfolio_material/portfolio_Header_logo.jpg" />
     </div>
    );
  }
}

export default Header;
